import Global from "../components/Global/Global";
import Hero from "../components/Hero/Hero";
import IndonesiaTable from "../components/IndonesiaTable";
import { useEffect,useState } from "react";
import ENDPOINTS from "../utils/constants/endpoints";
import axios from "axios";
const Indonesia = () =>{
    const [dataIndonesia,setDataIndonesia] = useState([])

    useEffect(()=>{
        getDataIndonesia()
    },[])

    async function getDataIndonesia(){
        const response = await axios(ENDPOINTS.GLOBAL);
        const dataGlobal = (response.data.global);

        console.log(response.data.global);
        setDataIndonesia(dataGlobal);
    }
    return(
        <div>
            <Hero/>
            <Global/>
            <IndonesiaTable/>
        </div>
    )
}
export default Indonesia;
